  ### INPUT ###

  read_input:

  # Read from keyboard, move/select accordingly

		li 	  $t0, 	0xffff0000   # Receiver Control register address
		li 	  $t1, 	0xffff0004   # Receiver Data register address

	read_input_loop:

		lw    $t2,  0($t0)      # Read Receiver Control register
		andi  $t2,  $t2,  1     # Mask out Ready bit
		beqz  $t2,  read_input_loop
		lw    $t3,	0($t1)

    beq   $t3,  104,  move_left
    beq   $t3,  106,  move_down
    beq   $t3,  107,  move_up
    beq   $t3,  108,  move_right
    beq   $t3,  10,   draw_play_area

    jal 	read_input_loop